// Home.js
import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="home-content">
      <div className="text-section">
        <h2>Connectez-vous avec des opportunités de bénévolat enrichissantes et contribuez à des actions communautaires qui font la différence....</h2>
      </div>
      <div className="logo-section">
        <img src="./images/Logo.png" alt="Logo" className="logo" />
      </div>
    </div>
  );
}

export default Home;
